@refuturing @futuristpaul Bonus! It returns them in classic reverse chronology. 

Bonus! It does not return ads.

All it shows is the tweets your followers sends. You can then check to see if there are replies and if so you can click on the tweet to see them, but otherwise you don‚Äôt see them.

@refuturing @futuristpaul Here is the solution to your issue. On the Twitter website or app, paste this string into search: 

filter:follows -filter:replies

You can then save it as a saved search. Then after you click search, click LATEST. This returns only Tweets (no RTs) from your followers.

